As the movie starts, during the Walt Disney logo, we hear a voice. This turns out to be Miley warming up. After a few backstage moments, a huge box comes down, and out comes Miley (as Hannah) and she sings Rockstar. After that we go back in time a few weeks and see Miley during rehearsals. The movie focuses on backstage moments and rehearsals for the concert as well as the performances of her songs.

Songs:

MILEY AS HANNAH: Rock Star, Life's What You Make It, Just Like You, Nobody's Perfect, I Got Nerve, We Got the Party feat Jonas Brothers.

JONAS BROTHERS INTERLUDE: When You Look Me In The Eyes and Year 3000

MILEY AS HERSELF: Start All Over, See You Again, Let's Dance, I Miss You, G.N.O. (Girl's Night Out) and The Best of Both Worlds.
